function List() {
  const fruits = [
    { id: 1, name: "aplle", calories: 95 },
    { id: 1, name: "orange", calories: 45 },
    { id: 1, name: "coconut", calories: 105 },
    { id: 1, name: "pineapple", calories: 95 },
  ];
  const ListItems = fruits.map((fruit) => {
    return <li>{fruit}</li>;
  });
  return <ol>{ListItems}</ol>;
}

export default List;
